3D Smile - компания, занимающаяся коррекцией улыбки и прикуса с помощью технологии элайнеров. 

Наше приложение создано, чтобы наглядно показать вам процесс коррекции на примере нескольких клинических случаев.

С помощью технологии дополненной реальности вы сможете детально рассмотреть процесс коррекции каждого пациента.  3D-модель челюсти помогает детально изучить отдельный случай и проследить динамику лечения с помощью элайнеров. 

Каждый клинический случай сопровождается интерактивной  инфографической визуализацией и озвучкой.


Как работает приложение:
1.  Пользователь запускает приложение;
2.  Выбирает одну из четырех AR-визуализаций, которые отображены кнопками на главной странице;
3.  Выбирает место, где появится визуализация;
4.  На экране мобильного устройства появляется сцена в дополненной реальности;

Приложение предназначено для ограниченного использования специалистами здравоохранения. Для получения доступа, пожалуйста, свяжитесь с нами по адресу: info@3d-smile.ru
